post_text:
A few quick reminders Barons as you prepare for the week ahead:
1. Remote learning will not take place Mon and Tues as teachers will be using these days to prepare for the weeks ahead - expect to hear from your teachers Wednesday;
2. Chromebook Pick Up is on be Monday and Tuesday;
3. Meal Distribution will take place on Monday and;
4 The BVHS parking lot is now WiFi accessible.

Please visit the district website for details about these items, who to contact should you have questions and updated information on the COVID-19 pandemic. Information will continue to be shared on the district website and on social media.

Also don't forget to show your Baron Pride by participating in the District-wide Spirit Week activities!

